import React from "react";
const enzo = require("../../images/enzo-10-4-2019sml.jpeg");
function IsLoading(props) {
  console.log(props);
  if (props.isLoading) {
    return (
      <div
        className="loading-image"
        style={{ backgroundImage: "url(" + enzo + ")" }}
      ></div>
    );
  }
}

export default IsLoading;
